import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Aquarella Fotografia</h1>
        <h3>By Noelia Abate</h3>
        <nav>
          <ul>
            <li>Portfolio</li>
            <li>Contacto</li>
            <li>Precios</li>
          </ul>
        </nav>
      </header>
      <section>

      </section>
    </div>
  );
}

export default App;
